import './App.css';
import React from 'react';
import './Header/Header';
import Header from './Header/Header';
import {Card} from './Body/Card';



function App() {
  return (
    <div className ='App'>
    <Header name='manuel'/>

    <Card title= 'peimeiro sapo feio' src='https://greensavers.sapo.pt/wp-content/uploads/2020/06/sapo.jpg'/>
    <Card src='https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Bufotes_balearicus_female.jpg/800px-Bufotes_balearicus_female.jpg'/>
    </div>
  );
}

export default App;
